import React from "react";
import Footer from "./Footer";
import Social from "./Social";
import Menu from "./Menu";
import Form from "./Form";

function SixthScreen() {
  return (
    <Footer>
      <Social />
      <Menu />
      <Form />
    </Footer>
  );
}

export default SixthScreen;
